import styled from "styled-components";
import Container from "../../../Layout/Container";
import HorizontalLine from "../../HorizontalLine copy";
import Header from "../Header";

const StyledRooms = styled.div`
  width: 75%;
`;

const Rooms = () => {
  return (
    <StyledRooms>
      <Header>
        <p
          style={{
            fontSize: "16px",
            fontWeight: 700,
            letterSpacing: "2px",
            marginLeft: "22px",
          }}
        >
          ACTIVE GAMES (4)
        </p>
      </Header>
      <Container width="80%">
        <HorizontalLine width="100%"></HorizontalLine>
      </Container>
    </StyledRooms>
  );
};

export default Rooms;
